  depth contours at 5 meter intervals of interferometric sonar data collected offshore
  of Massachusetts within northern Cape Cod Bay (CCB_5MCNTR Esri Shapefile, Geographic,
  WGS84).\",\n\t\"tracking_summary\": {\n\t\t\"total\": 26,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
